import React from 'react';
const Image = ({ setSelectedImg }) => {
    const photos = [{
        photo: './Photos/eagle.jpg',
        text:"Penguin + Eagle"
    },
        {
            photo: './Photos/stuffedanimal.jpg',
            text:"Porcupine"
        },
        {
            photo: './Photos/koala.jpg',
            text:"koala"
        }
    ]
    return (
        <div className="img">
            {photos.map((e, idx) =>
                <img
                    style = {{height:'300px'}} src = {require( `${ e.photo }` ) } alt = 'uploaded'
                    key={idx}  whileHover={{ opacity: 0}}s
                    onClick={() => setSelectedImg(e.photo)}
                />
            )}
        </div>
    )
}

export default ImageGrid;
